import React from "react";
import "./FinalCover.css";

function DisplayFinalCover() {
  return (
    <div>
      <h1 className="final-title">Here is your Groovelist!</h1>
      <div className="your-grooveList">
        <div className="your-cover">
          <img
            src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.nationalgeographic.com%2Fanimals%2Fmammals%2Ffacts%2Fdomestic-dog&psig=AOvVaw18wC2OxOeWuHcCHms_79Rn&ust=1682317090736000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCLCQ5Natv_4CFQAAAAAdAAAAABAE"
            alt=""
          />
        </div>
        <div className="your-tracklist"></div>
      </div>
    </div>
  );
}

export default DisplayFinalCover;
